import React from "react";

import Header from "../components/Header";
import Card from "../components/Card";

const Homepage = ({ data }) => {
  return (
    <div>
{/*         {console.log(articles)} */}
        <Header/>  
        <p>Welcome to the Homepage</p>
        <div > {/* class="container" */}
            <div class="row">
                {data.map((article) => (
                    <Card
                        article={article}
                    />
                ))}
            </div>
        </div>
    </div>
    
  );
};

export default Homepage;
